// src/components/PatientList.jsx
import React from 'react';
import { FaSearch, FaEllipsisH } from 'react-icons/fa';

const patients = [
    {
        name: "Emily Williams",
        gender: "Female",
        age: 18,
        profilePicture: "https://fedskillstest.ct.digital/4.png"
    },
    {
        name: "Ryan Johnson",
        gender: "Male",
        age: 45,
        profilePicture: "https://fedskillstest.ct.digital/4.png"  
    },
    {
        name: "Brandon Mitchell",
        gender: "Male",
        age: 36,
        profilePicture: "https://fedskillstest.ct.digital/4.png"  
    },
    {
        name: "Jessica Taylor",
        gender: "Female",
        age: 28,
        profilePicture: "https://fedskillstest.ct.digital/4.png"  
    },
    {
        name: "Samantha Johnson",
        gender: "Female",
        age: 56,
        profilePicture: "https://fedskillstest.ct.digital/4.png"  
    },
    {
        name: "Ashley Martinez",
        gender: "Female",
        age: 54,
        profilePicture: "https://fedskillstest.ct.digital/4.png"  
    },
    {
        name: "Olivia Brown",
        gender: "Female",
        age: 32,
        profilePicture: "https://fedskillstest.ct.digital/4.png"  
    },
    {
        name: "Olivia Brown",
        gender: "Female",
        age: 32,
        profilePicture: "https://fedskillstest.ct.digital/4.png"  
    },
    
];

const PatientList = () => {
    return (
        <div className="absolute top-[122px] left-[18px] w-[367px] h-[1054px] bg-white rounded-[16px] opacity-100 overflow-y-auto">
            <div className="flex items-center justify-between p-4  ">
                <h2 className="text-[24px] font-bold">Patients</h2>
                <FaSearch className="text-gray-500 w-[17.99] h-[18px]" />
            </div>
            <div className="p-4 space-y-4">
                {patients.map((patient, index) => (
                    <div key={index} className="flex items-center  py-2">
                        <img
                            src={patient.profilePicture}
                            alt={patient.name}
                            className="w-16 h-16 rounded-full object-cover"
                        />
                        <div className="ml-4 flex-1">
                            <div className="flex items-center justify-between">
                                <div className="text-lg font-semibold">{patient.name}</div>
                                <FaEllipsisH className="text-gray-500" />
                            </div>
                            <div className="text-sm text-gray-600">{patient.gender}, {patient.age} years</div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default PatientList;
